import React, { Component } from 'react'
import Col from './Col'

class Home extends Component{

    handleClick = (myLink) => {
        window.location.href = myLink;
    }

    render() {
        return (
            <Col className="toSold" onClick={this.handleClick('/sold')}>
                <div> SOLD: </div>
            </Col>
        )
    }

}

export default Home;
